  false,\n\t\"url\": null,\n\t\"notes\": \"Holes in the ground are a very important
  feature of black-footed ferret habitat. The number, distribution, and activity level
  of prairie dog burrows is related to prairie dog abundance (ferret food) and directly
  affects/provides escape cover and shelter for ferrets. Habitat attributes, such
  as burrow distribution, will be important in understanding ferret movements, dispersal,
  habitat selection, and ultimately reproduction and survival. A current and accurate
  map of the prairie dog habitat on which black-footed ferrets would be released in
  the fall of 1994 was needed. This project attempted to map the location of every
  prairie dog burrow on the ferret release site. Global Positioning Systems (GPS)
  provide a mechanism to accurately map geographical features and import the data
  into Geographical Information Systems (GIS). GPS and GIS have been used during the
  last several years to map prairie dog colony boundaries in Southern Phillips County,
  Montana. The effort described in this chapter used GPS and GIS to produce maps of
  all prairie dog burrows on the ferret release site and a boundary of the prairie
  dog colonies by connecting the outer perimeter of burrows.\",\n\t\"owner_org\":
